      "place_of_origin": "Germany",
      "description": "<p>In the fifteenth century, prints were frequently published with conspicuously empty banderoles, blanks that viewers could complete by adding titles or fill in as early thought or speech bubbles. Israhel van Meckenem employed these winding, decorative banners to draw viewers into his coyly provocative <em>Falconer and Lady</em> and other images from his series of twelve secular couples involved in everyday activities, from church-going to playing music. These courtly lovers wear sumptuous clothing and participate in falconry, a popular hunting pastime of the wealthy. The hooded bird may symbolize the lovers’ cautious restraint.</p>\n",
