      "place_of_origin": "United States",
      "description": "<p>The barn represented in this drawing is repeatedly used by Wolf Kahn to study the interaction of color, light, and form. Like many of his contemporaries, Kahn worked <em>en plein air</em>, examining the structure from different angles, scales, and times of day to discover its varied meanings, much like Claude Monet did in his famous images of haystacks. When this drawing is viewed with other depictions of the barn, it is possible not only to reconstruct the building in the round, but also to understand Kahn’s perceptions of his surroundings and the different methods he used to explore them.</p>\n",
